import React from 'react';

const App = () => {

    const pStyle = {
        color: "red",
        backgroundColor: "#bfa",
        border: "blue solid 1px"
    };

    return (
        <div>
            <p style={pStyle}>I am a P</p>
            <button>Click me</button>
        </div>
    );
};

export default App;
